import React from 'react';
import Search from './Search';

function Dashboard() {
  return (
    <div className='max-w-[1080px] w-full h-screen px-24 flex flex-col items-center gap-12 bg-secondary-tan'>
      <div className='w-full h-[88px] bg-secondary-tan'></div>
      <Search />
    </div>
  );
}

export default Dashboard;
